import React from 'react';
import NewCard from '../components/common/NewCard';
import one from '../assets/images/product/1.png';
const GuideDtail = () => {
  return (
    <>
      <NewCard title="가이드프로필상세" parent="가이드관리">
        <div className="card-block row">
          <div className="col-sm-12 col-lg-12 col-xl-12">
            <h5>프로필상세 </h5>
            <div>승인대기</div>
            <div>
              <div>
                <div>
                  <div>이름</div>
                  <div>나이</div>
                  <div>사용가능언어</div>
                </div>
                <div>
                  <div>영문이름,한문이름</div>
                  <div>20대</div>
                  <div>중국어/영어</div>
                </div>
              </div>
              <img src={one} alt="Gallery" className="img-100 " />
            </div>
          </div>
        </div>
      </NewCard>
    </>
  );
};

export default GuideDtail;
